import React from 'react';

const RecommendedMovies = ({poster, key, title, movie_id}) => {

    return (
        <div className="movie-list" id={key}>
        {poster && 
        <img src={poster} id={movie_id} alt={title}/>
        }
        {poster && 
        <button className="btn-play"></button>
        }
        </div>
    );
};

export default RecommendedMovies;
